import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <p>This text is printed inside the App component</p>
      <div>
        <button>Up</button>
        <button>Down</button>
        <button>Left</button>
        <button>Right</button>
      </div>
    </div>
  );
}

export default App;
